import { feedbackDataApi, feedbackFromApi } from '@/api/kefu';
export default {
  name: "feedback",
  props: {
    change: Boolean
  },
  data: function data() {
    return {
      loading: false,
      isShow: false,
      formItem: {
        rela_name: '',
        content: '',
        phone: ''
      },
      notice: '',
      ruleValidate: {
        rela_name: [{
          required: true,
          message: '请输入您的姓名',
          trigger: 'blur'
        }],
        content: [{
          required: true,
          message: '请输入留言内容',
          trigger: 'blur'
        }],
        phone: [{
          required: true,
          message: '请填写手机号码',
          trigger: 'change'
        }, {
          pattern: /^1[3456789]\d{9}$/,
          message: "手机号码格式不正确",
          trigger: "blur"
        }]
      }
    };
  },
  mounted: function mounted() {
    this.getNotice();
  },
  methods: {
    handleSubmit: function handleSubmit(name) {
      var _this = this;

      this.loading = true;
      this.$refs[name].validate(function (valid) {
        if (valid) {
          feedbackFromApi(_this.formItem).then(function (res) {
            _this.loading = false;
            _this.isShow = true;
          }).cache(function (err) {
            _this.loading = false;

            _this.$Message.error(err.msg);
          });
        } else {}
      });
    },
    close: function close() {
      this.$emit("closeChange", false);
    },
    // 广告
    getNotice: function getNotice() {
      var _this2 = this;

      feedbackDataApi().then(function (res) {
        _this2.notice = res.data.feedback;
      }).cache(function (err) {
        _this2.$Message.error(err.msg);
      });
    }
  }
};
